import React from "react";
import { useNavigate } from "react-router-dom";

function InstructorDone() {
  const navigate = useNavigate();

  return (
    <div className="InstructorDone">
      <button
        className="InstructorDone_Copy"
        //insert code here to copy tokens sent from zkp to clipboard
      >
        Copy Tokens to Clipboard
      </button>
      <button
        className="InstructorDone_Back"
        onClick={() => navigate("/MainHome")}
      >
        Done
      </button>
    </div>
  );
}

export default InstructorDone;
